import React, { useState } from 'react';
import { supabase } from '../../services/supabaseClient';

const TestLogin: React.FC = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [status, setStatus] = useState<string>('');
  const [loading, setLoading] = useState(false);
  const [user, setUser] = useState<any>(null);

  const checkConnection = async () => {
    setStatus('Checking connection...');
    setLoading(true);
    
    try {
      const { data, error } = await supabase.from('blood_types').select('*').limit(1);
      
      if (error) {
        setStatus(`Connection error: ${error.message}`);
      } else {
        setStatus(`Connection successful! Retrieved: ${JSON.stringify(data)}`);
      }
    } catch (err: any) {
      setStatus(`Exception: ${err.message}`);
    } finally {
      setLoading(false);
    }
  };

  const checkSession = async () => {
    setStatus('Checking session...');
    setLoading(true);
    
    try {
      const { data, error } = await supabase.auth.getSession();
      
      if (error) {
        setStatus(`Session error: ${error.message}`);
      } else if (data.session) {
        setStatus(`Session found: ${data.session.user.email}`);
        setUser(data.session.user);
      } else {
        setStatus('No active session');
      }
    } catch (err: any) {
      setStatus(`Exception: ${err.message}`);
    } finally {
      setLoading(false);
    }
  };

  const handleLogin = async (e: React.FormEvent) => {
    e.preventDefault();
    setStatus('Logging in...');
    setLoading(true);
    
    try {
      const { data, error } = await supabase.auth.signInWithPassword({
        email,
        password
      });
      
      if (error) {
        setStatus(`Login error: ${error.message}`);
      } else {
        setStatus(`Login successful! User: ${data.user?.email}`);
        setUser(data.user);
      }
    } catch (err: any) {
      setStatus(`Exception: ${err.message}`);
    } finally {
      setLoading(false);
    }
  };

  const handleLogout = async () => {
    setStatus('Logging out...');
    setLoading(true);
    
    try {
      const { error } = await supabase.auth.signOut();
      
      if (error) {
        setStatus(`Logout error: ${error.message}`);
      } else {
        setStatus('Logged out successfully');
        setUser(null);
      }
    } catch (err: any) {
      setStatus(`Exception: ${err.message}`);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ maxWidth: '500px', margin: '0 auto', padding: '20px' }}>
      <h1>Supabase Auth Test</h1>
      
      <div style={{ marginBottom: '20px' }}>
        <button 
          onClick={checkConnection} 
          disabled={loading}
          style={{ marginRight: '10px', padding: '8px 16px' }}
        >
          Test Connection
        </button>
        
        <button 
          onClick={checkSession} 
          disabled={loading}
          style={{ padding: '8px 16px' }}
        >
          Check Session
        </button>
      </div>
      
      {user ? (
        <div style={{ marginBottom: '20px', padding: '15px', border: '1px solid #ddd', borderRadius: '5px' }}>
          <h3>Logged in as: {user.email}</h3>
          <p>User ID: {user.id}</p>
          <button 
            onClick={handleLogout} 
            disabled={loading}
            style={{ padding: '8px 16px', backgroundColor: '#f44336', color: 'white', border: 'none', borderRadius: '4px' }}
          >
            Logout
          </button>
        </div>
      ) : (
        <form onSubmit={handleLogin} style={{ marginBottom: '20px' }}>
          <div style={{ marginBottom: '10px' }}>
            <label style={{ display: 'block', marginBottom: '5px' }}>Email:</label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
              disabled={loading}
              style={{ width: '100%', padding: '8px' }}
            />
          </div>
          
          <div style={{ marginBottom: '15px' }}>
            <label style={{ display: 'block', marginBottom: '5px' }}>Password:</label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              disabled={loading}
              style={{ width: '100%', padding: '8px' }}
            />
          </div>
          
          <button 
            type="submit" 
            disabled={loading}
            style={{ padding: '8px 16px', backgroundColor: '#4CAF50', color: 'white', border: 'none', borderRadius: '4px' }}
          >
            Login
          </button>
        </form>
      )}
      
      <div style={{ 
        marginTop: '20px', 
        padding: '15px', 
        backgroundColor: '#f5f5f5', 
        borderRadius: '5px',
        minHeight: '100px'
      }}>
        <h3>Status:</h3>
        <pre>{status}</pre>
      </div>
    </div>
  );
};

export default TestLogin;
